  input: TEXT,F3XA,,"As noted in the Commission's letter, the Committee's report showed
    that it failed to transmit all earmarked contributions within the permissible
    time period and to include entries in both Schedule A and Schedule B for all earmarked
    contributions. Upon further review, the Committee discovered that it failed to
    include entries for several additional earmarked contributions and also failed
    to note that a certain advance to the Committee's connected organization was used
    for in-kind contributions. These mistakes have been corrected on the Committee's
    amended report (along with two other mistakes that are noted in the memo text
    for the specific entries -- those mistakes involve an excess contribution to a
    candidate, as noted in the Commission's letter, for which the Committee has obtained
    a refund,and a reported contribution that was never receieved by the Committee).
    A combination of inexperience, holiday scheduling difficulties, and a stolen laptop
    computer all contributed to these mistakes. These difficulties are no excuse for
    its mistakes, but the Committee wants the Commission to be aware of the circumstances.
    The Committee also has instituted procedures to prevent these mistakes from recurring.
    The Committee takes seriously its responsibility to comply in full with all legal
    requirements."
