  input: TEXT,SB23,SB23.4436,"Due to a mistake by inexperienced staff, the Committee
    erroneously gave the Hilleary for Senate Campaign two $2,500.00 checks (totaling
    $5,000.00), even though the Committee had not at that time qualified as a multi-candidate
    committee. The Treasurer requested a refund from the Hilleary Campaign on July
